import { useEffect,useState } from "react";

const Home=()=>{
    const [workout,changeworkout]=useState(null);
    useEffect(()=>{
        const fetchworkout= async ()=>{
            const workouts=await fetch("/api/workouts")
            const res=(await workouts).json()
            if (workouts.ok){
                changeworkout(res)

            }

        }
        fetchworkout()
    },[])
    return (
        <div className="home">
            {workout && workout.map(()=>(
                <p key={workout._id}>{workout.title}</p>
            ))}
        </div>
    )
}
export default Home;
